USE university;
CREATE TABLE unviersity (
    `UNITID` INT,
    `NAME` VARCHAR(91) CHARACTER SET utf8,
    `CITY` VARCHAR(24) CHARACTER SET utf8,
    `STABBR` VARCHAR(2) CHARACTER SET utf8,
    `ZIP` VARCHAR(10) CHARACTER SET utf8,
    `INSTURL` VARCHAR(124) CHARACTER SET utf8,
    `SAT_AVG` VARCHAR(4) CHARACTER SET utf8
);
